import React from "react";
import { Heading } from "../../constant/styles/text";
import TalkTab from "./talkTab";

const TalkList = () => {
    return (

        <div className={` grid grid-cols-1 p-4 bg-gray-100 dark:bg-dark-800 w-full`}>
      <Heading>Join a Talk</Heading>
      <div className='grid grid-cols-1 bg-gray-200 dark:bg-dark-00 p-2'>
                {/* maps of talk tabs */}
                <TalkTab/>
      </div>
    </div>
  );
};

export default TalkList;
